"use strict";(self.webpackChunkio_github_lyrihkaesa=self.webpackChunkio_github_lyrihkaesa||[]).push([["7401"],{17053:function(a,e,n){n.r(e),n.d(e,{default:()=>d,frontMatter:()=>t,metadata:()=>r,assets:()=>s,toc:()=>k,contentTitle:()=>g});var r=JSON.parse('{"id":"project-management/023","title":"Jalan untuk menjadi project manager","description":"Nama saya JuAnne. Saya adalah Senior Program Manager di Google. Saya merupakan generasi pertama keturunan Cina-Amerika. Keluarga saya dan saya pindah ke Amerika Serikat saat saya masih muda. Orang tua saya bekerja sangat keras saat saya tumbuh dewasa dan saya banyak menghabiskan waktu sendirian, melakukan perawatan diri saya sendiri, merencanakan makanan saya, mengerjakan pekerjaan rumah, dan lain sebagainya. Saya merasa bahwa saya mendapatkan sedikit keterampilan manajemen program saya dari rasa tertib saya yang tinggi, karena saya harus selalu teratur. Perjalanan saya menjadi seorang manajer proyek dimulai sebagai analis sistem bisnis. Saya menulis persyaratan atau mengumpulkan persyaratan untuk pelanggan kami dan menerjemahkannya menjadi dokumentasi bagi insinyur kami sehingga mereka dapat mengimplementasikannya. Melalui proses itu, saya menjadi seorang manajer proyek. Saya mulai mengelola jangka waktu, mengelola tugas-tugas, memahami semua komponen, dan siapa yang perlu terlibat. Di situlah Anda mendapatkan seorang manajer proyek. Menurut saya, yang paling menyenangkan tentang menjadi seorang manajer proyek adalah bekerja dengan orang-orang. Anda bertemu dengan orang-orang yang berbeda, dengan kepribadian yang berbeda. Kadang-kadang Anda bisa bepergian ke tempat-tempat untuk bertemu mereka, tapi bahkan ketika Anda tidak bertemu secara langsung, bertemu dengan orang-orang baru dan memahami bagaimana kita berinteraksi, bagaimana orang berinteraksi dan berperilaku sangat menarik. Saya pikir jika Anda membangun hubungan, fokus pada hubungan itu, dan benar-benar memahami gaya kerja mereka, asal mereka dari mana, apa kekhawatiran mereka, itu akan membantu hubungan kerja Anda menjadi lebih baik. Anda dapat berkomunikasi dengan mereka dengan gaya yang diperlukan. Anda dapat bekerja dengan mereka dengan gaya yang lebih dapat diterima dan itu akan membuat proyek menjadi lebih baik secara keseluruhan.","source":"@site/articles/learning/81-project-management/023.md","sourceDirName":"81-project-management","slug":"/project-management/023","permalink":"/learning/project-management/023","draft":false,"unlisted":false,"tags":[],"version":"current","frontMatter":{},"sidebar":"tutorialSidebar","previous":{"title":"Nilai seorang project manager","permalink":"/learning/project-management/022"},"next":{"title":"Bagaimana project manager memengaruhi organisasi","permalink":"/learning/project-management/024"}}'),i=n("85893"),m=n("50065");let t={},g="Jalan untuk menjadi project manager",s={},k=[{value:"Rangkuman",id:"rangkuman",level:2}];function u(a){let e={h1:"h1",h2:"h2",header:"header",p:"p",...(0,m.a)(),...a.components};return(0,i.jsxs)(i.Fragment,{children:[(0,i.jsx)(e.header,{children:(0,i.jsx)(e.h1,{id:"jalan-untuk-menjadi-project-manager",children:"Jalan untuk menjadi project manager"})}),"\n",(0,i.jsx)(e.p,{children:"Nama saya JuAnne. Saya adalah Senior Program Manager di Google. Saya merupakan generasi pertama keturunan Cina-Amerika. Keluarga saya dan saya pindah ke Amerika Serikat saat saya masih muda. Orang tua saya bekerja sangat keras saat saya tumbuh dewasa dan saya banyak menghabiskan waktu sendirian, melakukan perawatan diri saya sendiri, merencanakan makanan saya, mengerjakan pekerjaan rumah, dan lain sebagainya. Saya merasa bahwa saya mendapatkan sedikit keterampilan manajemen program saya dari rasa tertib saya yang tinggi, karena saya harus selalu teratur. Perjalanan saya menjadi seorang manajer proyek dimulai sebagai analis sistem bisnis. Saya menulis persyaratan atau mengumpulkan persyaratan untuk pelanggan kami dan menerjemahkannya menjadi dokumentasi bagi insinyur kami sehingga mereka dapat mengimplementasikannya. Melalui proses itu, saya menjadi seorang manajer proyek. Saya mulai mengelola jangka waktu, mengelola tugas-tugas, memahami semua komponen, dan siapa yang perlu terlibat. Di situlah Anda mendapatkan seorang manajer proyek. Menurut saya, yang paling menyenangkan tentang menjadi seorang manajer proyek adalah bekerja dengan orang-orang. Anda bertemu dengan orang-orang yang berbeda, dengan kepribadian yang berbeda. Kadang-kadang Anda bisa bepergian ke tempat-tempat untuk bertemu mereka, tapi bahkan ketika Anda tidak bertemu secara langsung, bertemu dengan orang-orang baru dan memahami bagaimana kita berinteraksi, bagaimana orang berinteraksi dan berperilaku sangat menarik. Saya pikir jika Anda membangun hubungan, fokus pada hubungan itu, dan benar-benar memahami gaya kerja mereka, asal mereka dari mana, apa kekhawatiran mereka, itu akan membantu hubungan kerja Anda menjadi lebih baik. Anda dapat berkomunikasi dengan mereka dengan gaya yang diperlukan. Anda dapat bekerja dengan mereka dengan gaya yang lebih dapat diterima dan itu akan membuat proyek menjadi lebih baik secara keseluruhan."}),"\n",(0,i.jsx)(e.h2,{id:"rangkuman",children:"Rangkuman"}),"\n",(0,i.jsx)(e.p,{children:"JuAnne adalah seorang Senior Program Manager di Google yang lahir dan dibesarkan di Amerika Serikat sebagai generasi pertama imigran Tionghoa. JuAnne mendapatkan keterampilan manajemen programnya dari pengalaman masa kecilnya dalam mengatur dirinya sendiri. Awalnya, ia bekerja sebagai analis sistem bisnis dan kemudian menjadi seorang project manager dengan mengelola timeline, tugas, dan memahami semua komponen yang terlibat. JuAnne merasa pekerjaannya sebagai project manager sangat menyenangkan karena ia dapat bekerja dengan orang-orang dengan berbagai macam kepribadian dan dapat belajar bagaimana orang saling berinteraksi dan berperilaku. Menurut JuAnne, penting untuk membangun hubungan yang baik dengan orang lain dan memahami gaya kerja mereka agar dapat bekerja sama secara lebih efektif dan memperbaiki proyek secara keseluruhan."})]})}function d(a={}){let{wrapper:e}={...(0,m.a)(),...a.components};return e?(0,i.jsx)(e,{...a,children:(0,i.jsx)(u,{...a})}):u(a)}},50065:function(a,e,n){n.d(e,{Z:function(){return g},a:function(){return t}});var r=n(67294);let i={},m=r.createContext(i);function t(a){let e=r.useContext(m);return r.useMemo(function(){return"function"==typeof a?a(e):{...e,...a}},[e,a])}function g(a){let e;return e=a.disableParentContext?"function"==typeof a.components?a.components(i):a.components||i:t(a.components),r.createElement(m.Provider,{value:e},a.children)}}}]);